import React, { Component } from 'react'

export class Results extends Component {
    state = {
        books : []
    };

    componentDidMount() {
        // Start fetching the repos when the component is first displayed
        fetch('https://www.googleapis.com/books/v1/volumes?q={henry}')
            .then(res => res.json())
            .then(data => data.items.map(item => this.setState(item.volumeInfo)));
    }

    render() {
        return (
            <div>
                <ul>
                    {}
                </ul>
            </div>
        )
    }
}

export default Results
